features.script:
var smoke_1_name = 'weed_smoke_1';
var smoke_2_name = 'weed_smoke_2';
var smoke_3_name = 'weed_smoke_3';
var smoke_4_name = 'weed_smoke_4';
var cough_sound_name = 'weed_cough';
var minRate = 1;
var maxRate = 500;

var smoke_1 = parcel.getFeatureById(smoke_1_name);
var smoke_2 = parcel.getFeatureById(smoke_2_name);
var smoke_3 = parcel.getFeatureById(smoke_3_name);
var smoke_4 = parcel.getFeatureById(smoke_4_name);
var cough_sound = parcel.getFeatureById(cough_sound_name);
var smokeOn = true;

feature.on('click', c=>{
  smokeOn = !smokeOn;
  if (!smokeOn) {
    smoke_1.set({emitRate:minRate});
    smoke_2.set({emitRate:minRate});
    smoke_3.set({emitRate:minRate});
    smoke_4.set({emitRate:minRate});
  }
  else {
    smoke_1.set({emitRate:maxRate});
    smoke_2.set({emitRate:maxRate});
    smoke_3.set({emitRate:maxRate});
    smoke_4.set({emitRate:maxRate});
    cough_sound.play();
  }
})

// Slide movement
var slide_1_name = 'passio_slide_1';
var slide_2_name = '';
var slide_3_name = '';
var displayed = true;

var slide_1 = parcel.getFeatureById(slide_1_name);

feature.on('click', c=>{
  console.log('clicked!');
  if (slide_1.scale.x == 1.75) {
    slide_1.scale = new Vector3(0,0,0);
  }
  else {
    slide_1.scale = new Vector3(1.75,1.75,0);
  }
  displayed = !displayed;
});

// Rotation
var rotationIncrement = 0.1;
var interval = 100;

setInterval(()=>{
  feature.rotation.y += rotationIncrement;
}, interval);

// Slide movement
var slide_1_name = 'passio_slide_1';
var slide_2_name = '';
var slide_3_name = '';
var displayed = true;

var slide_1 = parcel.getFeatureById(slide_1_name);

feature.on('click', c=>{
  if (displayed) {
    slide_1.scale.x = 0.01;
    slide_1.scale.y = 0.01;
    console.log('shrank!');
  }
  else {
    slide_1.scale.x = 1.75;
    slide_1.scale.y = 1.75;
    console.log('expanded!');
  }
  displayed = !displayed;
});
